  15,\n\t\"tags\": [],\n\t\"title\": \"Monthly and annual mean seawater temperature,
  salinity and density from 26 tide gauge sites during 1855-1993 (NCEI Accession 0000817)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-08-02T02:59:40.617222\",\n\t\"name\": \"monthly-and-annual-mean-seawater-temperature-salinity-and-density-from-26-tide-gauge-sites-duri\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Tidal observers at primary tide gauges
  of the United States Coast and Geodetic Survey (now the NOAA National Ocean Service)
  routinely measured seawater temperature and density throughout most of the 20th
  century with select sites well before. All available records for 26 sites have been
  digitized, although more paper file records may still exist for others. Students
  at Florida Institute of Technology provided the key entry and quality control. The
  purpose was to study trends in sea water temperature and density in support of increasing
